&lt;p&gt;
	This is a one-year project to apply a GIS analysis tool to new orbital data for lunar resource assessment and martian habitability identification.&amp;nbsp; We used ArcGIS, the state-of-the-art software for mapping, integrating, and analysis of spatial data. We focused on the assessment of several regional lunar pyroclastic deposits and habitability analysis in the Chryse-Acidalia portion of the martian lowlands.&amp;nbsp; This work expands upon a previous 3-year project enabled through IRD funds.&lt;/p&gt;
&lt;p&gt;
	&amp;nbsp;&lt;/p&gt;
&lt;p&gt;
	As a direct result of this project three scientific papers have been published:&lt;/p&gt;
