	Allen, C.C., Greenhagen, B.T., Donaldson Hanna, K.L., and Paige, D.P. (2012) Analysis of lunar pyroclastic deposit FeO abundances by LRO Diviner, &lt;em&gt;Journal of Geophysical Research, 117&lt;/em&gt;, E00H28, doi:10.1029/2011JE003982.&lt;/p&gt;
