	Oehler, D.Z. and Allen, C.C. (2012) Giant polygons and mounds in the lowlands of Mars: signatures of an ancient ocean ?, &lt;em&gt;Astrobiology&lt;/em&gt;, 12, 1-15.&lt;/p&gt;
